import React from 'react';
import "./checkbox.css"
import PropTypes from 'prop-types';


const Checkbox = () => (
    <label class="container">
      <input checked="checked" type="checkbox" />
      <div class="checkmark"></div>
  </label>
);

Checkbox.propTypes = {};

Checkbox.defaultProps = {};

export default Checkbox;
